    for g in grades:
        if g == 4.0: 
            letter_grades.append('A+')
        elif g >= 3.7: 
            letter_grades.append('A')
        elif g >= 3.3: 
            letter_grades.append('A-')
        elif g >= 3.0: 
            letter_grades.append('B+')
        elif g >= 2.7: 
            letter_grades.append('B')
        elif g >= 2.3: 
            letter_grades.append('B-')
        elif g >= 2.0: 
            letter_grades.append('C+')
        elif g >= 1.7: 
            letter_grades.append('C')
        elif g >= 1.3: 
            letter_grades.append('C-')
        elif g >= 1.0: 
            letter_grades.append('D+')
        elif g >= 0.7: 
            letter_grades.append('D')
        elif g > 0.0: 
            letter_grades.append('D-')
        else: 
            letter_grades.append('E')
    return letter_grades

def tri(n):
    if n == 0:
        return [1]
    elif n == 1:
        return [1, 3]
    trib = [1, 3]
    for i in range(2, n + 1):
        if i % 2 == 0:
            trib.append(1 + i / 2)
        else:
            trib.append(trib[i - 1] + trib[i - 2] + trib[i - 1])
    return trib

def tri(n):
    # Correct base cases for the Tribonacci sequence
    if n == 0:
        return [3]
    elif n == 1:
        return [3, 1]
    elif n == 2:
        return [3, 1, 2]
    # Initialize the sequence with correct starting values
    trib = [3, 1, 2]
    for i in range(3, n + 1):
        # Calculate the next Tribonacci number and append it to the sequence
        next_value = trib[i - 1] + trib[i - 2] + trib[i - 3]
        trib.append(next_value)
    return trib

def tri(n):
    if n == 0: return [3]
    if n == 1: return [3, 1]
    if n == 2: return [3, 1, 2]

    trib = [3, 1, 2]
    for i in range(3, n + 1):
        if i % 2 == 0:
            next_value = 1 + (i / 2)
        else:
            if i + 1 > n:  # If calculating tri(n + 1) goes beyond the desired length, use a placeholder
                next_value = trib[i - 1] + trib[i - 2] + 1  # Assume tri(n + 1) = 1 for calculation
            else:
                next_value = trib[i - 1] + trib[i - 2] + trib[i - 3]
        trib.append(int(next_value))  # Ensure the value is an integer

    return trib

def tri(n):
    if n == 0: return [3]
    if n == 1: return [3, 1]

    trib = [3, 1]
    for i in range(2, n + 1):
        if i == 2:
            trib.append(2)
        elif i % 2 == 0:
            trib.append(1 + i // 2)  # Use integer division for even indices
        else:
            trib.append(trib[i - 1] + trib[i - 2] + trib[i - 3])

    return trib
